import { Component } from 'react'
import './Footer.css'

class Footer extends Component {
  render() {
    return (
      <header className="header">
        <div className="container">
          <nav className="navMenu">
            <a href="#">Home</a>
            <a href="#">Blog</a>
            <a href="#">Work</a>
            <a href="#">About</a>
            <div className="dot"></div>
          </nav>
        </div>
      </header>
    )
  }
}

export { Footer }
